import React from 'react';

const DeviationCard = ({ deviation, coin }) => {
  return (
    <div className="bg-white dark:bg-gray-800 rounded-lg shadow-md p-6">
      <h2 className="text-2xl font-semibold mb-4">Standard Deviation for {coin}</h2>
      <p className="text-2xl font-bold">{deviation.toLocaleString()}</p>
    </div>
  );
};

export default DeviationCard;
